import React from 'react';
import { Paper, Table, TableHead, TableBody, TableRow, TableCell, TextField } from '@material-ui/core';


// 'data' is an object with the format {data: []}, with the array containing the times 
function MotorDataTable({ data, onNewNum }) {
  let dataComponents = [];
  // Basically removes the outer object layer and assigns an array to 'data'
  data = data;

  for (let i = 0; i < data.length; i++) {
    dataComponents.push(
      <TableRow>
        <TableCell>
          {data[i]}
        </TableCell>
      </TableRow>
    )
  }

  return (
    <React.Fragment>
      <Paper style={{height: 400, overflow: 'auto'}}>
        <Table style={{margin: '20px'}} stickyHeader>

          <TableHead>
            <TableRow>
              <TableCell>
                <strong>Times of Activation:</strong>
              </TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {dataComponents}
          </TableBody>

        </Table>
      </Paper>

      <div style={{display: 'flex', justifyContent: 'center', marginTop: '20px'}}>
        <TextField label="Number of Records:" variant="filled" onChange={(event) => onNewNum(event.target.value)}/> 
      </div>

    </React.Fragment>
  )
}


export default MotorDataTable;
